# frozen_string_literal: true

require "spec_helper"

describe Bibliothecary::Parsers::Sbom do
  it "has a platform name" do
    expect(described_class.platform_name).to eq("sbom")
  end

  let(:results) do
    # Without {full_sbom: true} no ecosystems will be returned because the platform_name is "sbom"
    results = described_class.analyse_contents(sbom_filename, load_fixture(sbom_filename), options: { full_sbom: full_sbom })
    # Ordering in the some of the sbom files is slightly off, especially for deps that show up more than once.
    results[:dependencies] = results[:dependencies].sort_by { |dep| [dep.name, dep.requirement] }
    results
  end

  context "with full_sbom: false" do
    let(:full_sbom) { false }

    context "with a CycloneDX JSON SBOM" do
      let(:sbom_filename) { "apache-airflow.cdx.json" }

      it "parses no dependencies" do
        expect(results).to eq({
                                platform: "sbom",
                                path: sbom_filename,
                                project_name: nil,
                                dependencies: [],
                                kind: "lockfile",
                                success: true,
                              })
      end
    end

    context "with a CycloneDX XML SBOM" do
      let(:sbom_filename) { "apache-airflow.cdx.xml" }

      it "parses no dependencies" do
        expect(results).to eq({
                                platform: "sbom",
